import React, { Component } from 'react';

import AddTeam from './AddTeam';
import AddMatch from './AddMatch';
import Table from './Table';

class App extends Component {

  constructor() {
    super();
    this.state = {
      teams: [],
      matchs: []
    };
  }

  getResponse(){
    alert("ENVIADO");

  }

  render (){
    return (
      <div className="App">

        <nav className="orange darken-4">
          <div className="container">
            <div className="nav-wrapper">
              <a href="#" className="brand-logo">Ligas Burocraticas Walnic</a>
            </div>
          </div>
        </nav>

        <div className="container">
          <div className="row">
            <div className="col s5">
              <AddTeam callback={this.getResponse.bind(this)}/>
              <AddMatch callback={this.getResponse.bind(this)}/>
            </div>
            <div className="col s7">
              <Table/>
            </div>
          </div>
        </div>

      </div>
    );
  }
}

export default App;
